import React from 'react'
import {Component} from 'react'
import AudioSpectrum from 'react-audio-spectrum'
import ProductList from '../productlist/item'
import data from '../data/products.json'
import song from '../media/01.mp3'


export default function Home(props) {
	return (
		<div>
			<div className='title'>
				<h2>Home</h2>
			</div>
			<audio id='audio' controls src={song}></audio>
				<AudioSpectrum
				  id="audio-canvas"
				  height={200}
				  width={800} 
				  audioId={'audio'}
				  capColor={'blue'}
				  capHeight={2}
				  meterWidth={2}
				  meterCount={128}
				  meterColor={[
				    {stop: 0, color: 'black'},
				    {stop: 0.5, color: 'gray'},
				    {stop: 1, color: 'gray'}
				  ]}
				  gap={3}
				/>
			</div>
		)
}
